export default function App() {
  return (
    <View style={styles.container}>
      <Text style={styles2.textStyle}>Ruiz, Sam Ryan</Text>
      <Text style={styles2.textStyle}>This is a dummy text</Text>
      <Button color={'green'} title='Tap me!'/>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  textStyle: {
    margin: 16, 
    borderWidth: 1, 
    borderColor:'red', 
    padding:10,
    backgroundColor:'blue',
    color: 'white',
  },
